import React from 'react';
import { StyleSheet} from 'react-native';

export const styles = StyleSheet.create({
  container: {
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  buttonContainer: {
    width: '280px',
    height: '40px',
    alignSelf: 'center',
    marginVertical: 30,
  },
  logo: {
    width: '220px',
    height: '70px',
    fontSize: 20,
    fontFamily: 'PingFangSC',
    fontWeight: "600",
    textAlign: 'center',
    color: '#68b0ab',
    lineHeight: 35,
  },
});
